import React from 'react';
import { person } from './data';

function App() {
  return (
    <div className='font color-body'>
      <div className='container'>

        <div className='row justify-content-center'>
          <div className='col-sm-8'>
           لديك {person.length} مواعيد اليوم
          </div>
        </div>

        <div className='row justify-content-center '>
          <div className='col-sm-8'>
          <div className='box border-bottom '>
            {person.length ? (person.map((item)=> {
              return(
                <div className='boxes'>
              <img className='images' src='images.jpg' />
              <div>
                <p className='parg'>{item.name}</p>
                <p className='par'>{item.date}</p>
              </div>
            </div>
              )
            })) : <div className='null'>لا يوجد مواعيد اليوم</div>} 
          </div>
          </div>
        </div>

        <div className='row justify-content-center'>
          <div className='col-sm-8 button-all'>
          <button className='button'>مسح الكل </button>
          <button className='button' >عرض البيانات</button>
          </div>
        </div>

      </div>
    </div>
  );
}

export default App;
